import React from "react";

function Page(props) {
    let listPages = [];
    console.log("in page", props);
    if (props.pages && props.pages.length > 0) {
        const pages = props.pages
        listPages = pages.map((page) => {
            return <li key={page.id}>{pages.name}</li>
        });
    }

    return (
        <ul>{listPages}</ul>
    )
}

export default Page;
